import React from 'react';
var arrOmage=[
    require('../../common/img/bg1'),
    require('../../common/img/bg2'),
    require('../../common/img/bg3'),
    require('../../common/img/bg4')
];
export default function Course(){
    return (
    <div>
        <ul id='course'>
            <li>
                <div className='Self-study'>
                    <img src={require('../../common/img/bg1.png')} alt=''/>
                </div>
            </li>
        </ul>
    </div>
    )
}
